import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Profile = () => {
    const [user, setUser] = useState(null);
    const [error, setError] = useState(null);
    const [formData, setFormData] = useState({
        coor_fname: '',
        coor_lname: '',
        coor_username: '',
        coor_email: '',
        coor_contact: '',
        coor_address: '',
        coor_role: '', // Assuming this is a selectable option
    });

    useEffect(() => {
        // Fetch user data when component mounts
        const fetchUser = async () => {
            try {
                const response = await axios.get('/api/coordinators/37'); // Replace with your actual endpoint
                setUser(response.data);
                setFormData({
                    coor_fname: response.data.coor_fname,
                    coor_lname: response.data.coor_lname,
                    coor_username: response.data.coor_username,
                    coor_email: response.data.coor_email,
                    coor_contact: response.data.coor_contact,
                    coor_address: response.data.coor_address,
                    coor_role: response.data.coor_role,
                });
            } catch (err) {
                setError('Error fetching user data');
            }
        };

        fetchUser();
    }, []);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (!user) return;

        try {
            const updatedUser = await axios.put(`/api/coordinators/${user.id}`, {
                data: formData // Send the updated form data
            });
            console.log('Updated User:', updatedUser.data); // Do something with the updated user
            setUser(updatedUser.data); // Update local user state if necessary
        } catch (error) {
            console.error('Error updating user:', error);
            setError('Failed to update user.');
        }
    };

    return (
        <div>
            {error && <p>{error}</p>}
            <form onSubmit={handleSubmit}>
                <div>
                    <label>First Name:</label>
                    <input
                        type="text"
                        name="coor_fname"
                        value={formData.coor_fname}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Last Name:</label>
                    <input
                        type="text"
                        name="coor_lname"
                        value={formData.coor_lname}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Username:</label>
                    <input
                        type="text"
                        name="coor_username"
                        value={formData.coor_username}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Email:</label>
                    <input
                        type="email"
                        name="coor_email"
                        value={formData.coor_email}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Contact Number:</label>
                    <input
                        type="text"
                        name="coor_contact"
                        value={formData.coor_contact}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Address:</label>
                    <input
                        type="text"
                        name="coor_address"
                        value={formData.coor_address}
                        onChange={handleChange}
                    />
                </div>
                <div>
                    <label>Role:</label>
                    <select
                        name="coor_role"
                        value={formData.coor_role}
                        onChange={handleChange}
                    >
                        <option value="">Select Role</option>
                        <option value="Admin">Admin</option>
                        <option value="User">User</option>
                        {/* Add more roles as needed */}
                    </select>
                </div>
                <button type="submit">Update Profile</button>
            </form>
        </div>
    );
};

export default Profile;
